CREATE TABLE IF NOT EXISTS countries (
    code varchar(20) PRIMARY KEY,
    country varchar(150),
    country_long varchar(150),
    population bigint,
    "GDP ($ per capita)" bigint,
    latitude double precision,
    longitude double precision
);

TRUNCATE countries CASCADE;

CREATE TABLE IF NOT EXISTS gender (
    id int PRIMARY KEY,
    name varchar(20)
);

TRUNCATE gender CASCADE;

CREATE TABLE IF NOT EXISTS athletes (
    code varchar(150) PRIMARY KEY,
    name varchar(150),
    gender int,
    function varchar(150),
    country_code varchar(20),
    nationality_code varchar(20),
    height int,
    weight real,
    disciplines varchar(150),
    events text,
    birth_date date,
    occupation text,
    lang varchar(150),
CONSTRAINT fk_gender
      FOREIGN KEY (gender) REFERENCES gender(id),
CONSTRAINT fk_country
      FOREIGN KEY (country_code) REFERENCES countries(code)
);

TRUNCATE athletes CASCADE;


CREATE TABLE IF NOT EXISTS coaches (
    code bigint PRIMARY KEY,
    name varchar(150),
    gender int,
    function varchar(150),
    country_code varchar(20),
    discipline varchar(150),
    birth_date date,
CONSTRAINT fk_gender
      FOREIGN KEY (gender) REFERENCES gender(id),
CONSTRAINT fk_country
      FOREIGN KEY (country_code) REFERENCES countries(code)
);

TRUNCATE coaches CASCADE;

CREATE TABLE IF NOT EXISTS medal_info (
    code int PRIMARY KEY,
    name varchar(20)
);

TRUNCATE medal_info CASCADE;

CREATE TABLE IF NOT EXISTS medals (
    medal_code int,
    medal_date date,
    discipline varchar(150),
    event text,
    winner_code varchar(150),
CONSTRAINT fk_medalinfo
      FOREIGN KEY (medal_code) REFERENCES medal_info(code)
);

TRUNCATE medals CASCADE;

CREATE TABLE IF NOT EXISTS results (
    date date,
    event_name text,
    discipline_name varchar(150),
    venue varchar(150),
    participant_code varchar(150),
    participant_type varchar(150),
    rank int,
    result varchar(150),
    result_type varchar(150)
);

TRUNCATE results CASCADE;


CREATE TABLE IF NOT EXISTS teams (
    code varchar(150),
    team varchar(150),
    country_code varchar(20),
    discipline varchar(150),
    events text,
    athletes_code varchar(150),
CONSTRAINT fk_country
      FOREIGN KEY (country_code) REFERENCES countries(code)
);

TRUNCATE teams CASCADE;

CREATE TABLE IF NOT EXISTS tokyo_medals (
    country_code varchar(20),
    gold_medal int,
    silver_medal int,
    bronze_medal int,
CONSTRAINT fk_country
      FOREIGN KEY (country_code) REFERENCES countries(code)
);

TRUNCATE tokyo_medals CASCADE;

CREATE TABLE IF NOT EXISTS venues (
    venue varchar(150),
    disciplines varchar(150),
    date_start date,
    date_end date
);

TRUNCATE venues CASCADE;

